import React from 'react';

import { QuestionWrapper, Text } from './styles';

const Question = ({ question, answers, nextQuestion, countQuestion }) => {


  return (


    <QuestionWrapper>
      <Text count>Question: {countQuestion + 1}</Text>
      <Text quest>{question}</Text>

      <Text answer>{`A: ${answers.answer_a}`}</Text >
      <Text answer>{`B: ${answers.answer_a}`}</Text >
      <Text answer>{`C: ${answers.answer_a}`}</Text >
      <Text answer>{`D: ${answers.answer_a}`}</Text >
      <Text answer>{`E: ${answers.answer_a}`}</Text >
      <Text answer>{`F: ${answers.answer_a}`}</Text >


      <button onClick={nextQuestion}> Next</button>


    </QuestionWrapper>


  );
};

export default Question;
